function.algorithm:
LOCAL
  x : SET OF representation_relationship;
END_LOCAL;
  IF relation.rep_1 IN relatives THEN
    RETURN (FALSE);
  END_IF;
  x := QUERY(r <* bag_to_set(USEDIN(relation.rep_1, 
  'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.REPRESENTATION_RELATIONSHIP.REP_2'
  )) | specific_relation IN TYPEOF(r));
  REPEAT i := 1 TO HIINDEX(x);
    IF NOT acyclic_representation_relationship(x[i], relatives + relation.rep_1
    , specific_relation) THEN
      RETURN (FALSE);
    END_IF;
  END_REPEAT;
  RETURN (TRUE);

LOCAL
  the_set : SET OF GENERIC : intype := [];
  i : INTEGER;
END_LOCAL;
  IF SIZEOF(the_bag) > 0 THEN
    REPEAT i := 1 TO HIINDEX(the_bag);
      the_set := the_set + the_bag[i];
    END_REPEAT;
  END_IF;
  RETURN (the_set);

LOCAL
  vertex : SET OF bus_structural_definition_or_node := [];
  edge : INTEGER := SIZEOF(input);
  vc : INTEGER := 0;
  vertex_degree : INTEGER := 0;
END_LOCAL;
  REPEAT i := 1 TO SIZEOF(input);
    vertex := vertex + input[i].precedent_element;
    vertex := vertex + input[i].subsequent_element;
  END_REPEAT;
  vc := SIZEOF(vertex);
  IF vc <> edge + 1 THEN
    RETURN (FALSE);
  END_IF;
  REPEAT i := 1 TO vc;
    vertex_degree := 0;
    REPEAT j := 1 TO SIZEOF(input);
      IF input[j].precedent_element = vertex[i] THEN
        vertex_degree := vertex_degree + 1;
      END_IF;
      IF input[j].subsequent_element = vertex[i] THEN
        vertex_degree := vertex_degree + 1;
      END_IF;
    END_REPEAT;
    IF vertex_degree > 2 THEN
      RETURN (FALSE);
    END_IF;
  END_REPEAT;
  RETURN (TRUE);

IF 
  'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.ABSTRACT_VARIABLE'
   IN TYPEOF(x) THEN
    RETURN (TRUE);
  ELSE
    IF (
    'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.FUNC' 
    IN TYPEOF(x)) AND (SIZEOF(QUERY(y <* x.terms | contains_variable(y))) > 0)
     THEN
      RETURN (TRUE);
    ELSE
      RETURN (FALSE);
    END_IF;
  END_IF;

