LOCAL
  shapes : SET OF assembly_component_2d_shape_model := [];
  shapes_in_context : SET OF physical_unit_planar_shape_model := [];
  assemblies : SET OF product_view_definition := [];
  i : INTEGER := 0;
  j : INTEGER := 0;
  in_context : BOOLEAN := TRUE;
END_LOCAL;
  REPEAT i := 1 TO SIZEOF(comp.occurrence_contexts);
    assemblies := assemblies + comp.occurrence_contexts[i].relating_view;
  END_REPEAT;
  shapes := bag_to_set(USEDIN(comp, 
  'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.ASSEMBLY_COMPONENT_2D_SHAPE_MODEL.SHAPE_CHARACTERIZED_COMPONENT'
  ));
  REPEAT i := 1 TO SIZEOF(shapes);
    shapes_in_context := bag_to_set(USEDIN(shapes[i]\geometric_model.
    context_of_items, 
    'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.GEOMETRIC_MODEL.CONTEXT_OF_ITEMS'
    ));
    in_context := FALSE;
    j := 1;
    REPEAT WHILE (j <= SIZEOF(shapes_in_context)) AND NOT in_context;
      in_context := shapes_in_context[j].shape_characterized_definition IN 
      assemblies;
      j := j + 1;
    END_REPEAT;
    IF NOT in_context THEN
      RETURN (FALSE);
    END_IF;
  END_REPEAT;
  RETURN (SIZEOF(shapes) > 0);

