LOCAL
  i : INTEGER;
  j : INTEGER;
  k : INTEGER;
END_LOCAL;
  IF (
  'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.ABSTRACT_VARIABLE'
   IN TYPEOF(thing)) AND (
  'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.RULE_DEFINITION'
   IN TYPEOF(thing.scope)) THEN
    accum := accum + thing;
  ELSE
    IF 
    'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.RULE_CONDITION'
     IN TYPEOF(thing) THEN
      REPEAT i := 1 TO HIINDEX(thing\atomic_formula.terms);
        accum := local_vars_aux(thing\atomic_formula.terms[i], accum);
      END_REPEAT;
    ELSE
      IF 
      'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.SIMPLE_CLAUSE'
       IN TYPEOF(thing) THEN
        REPEAT j := 1 TO HIINDEX(thing.formulas);
          accum := local_vars_aux(thing.formulas[j], accum);
        END_REPEAT;
      ELSE
        IF 
        'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.COMPLEX_CLAUSE'
         IN TYPEOF(thing) THEN
          REPEAT k := 1 TO HIINDEX(thing.clauses);
            accum := local_vars_aux(thing.clauses[k], accum);
          END_REPEAT;
        END_IF;
      END_IF;
    END_IF;
  END_IF;
  RETURN (accum);

LOCAL
  accum : SET OF scalar_variable := [];
END_LOCAL;
  RETURN (local_vars_aux(thing, accum));

LOCAL
  v1 : SET OF join_relationship := input1;
END_LOCAL;
  v1 := v1 + input2 + input3 + input4;
  RETURN (v1);

