LOCAL
  psto : LIST OF INTEGER := [0 : 1000];
  ssto : LIST OF INTEGER := [0 : 1000];
  sto : SET OF stratum_technology_occurrence := get_stack(input);
  i : INTEGER := 0;
  j : INTEGER := 0;
  pass : BOOLEAN := TRUE;
END_LOCAL;
  REPEAT i := 1 TO SIZEOF(sto);
    REPEAT j := 1 TO SIZEOF(input);
      IF input[j].precedent_sto :=: sto[i] THEN
        psto[i] := psto[i] + 1;
        IF psto[i] = 2 THEN
          pass := FALSE;
          ESCAPE;
        END_IF;
      END_IF;
      IF input[j].subsequent_sto :=: sto[i] THEN
        ssto[i] := ssto[i] + 1;
        IF ssto[i] = 2 THEN
          pass := FALSE;
          ESCAPE;
        END_IF;
      END_IF;
    END_REPEAT;
  END_REPEAT;
  RETURN (pass);

LOCAL
  category_assignments :  BAG  OF product_category_assignment;
  categories : SET OF STRING := [];
  i : INTEGER;
END_LOCAL;
  category_assignments := USEDIN(obj, 
  'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.PRODUCT_CATEGORY_ASSIGNMENT.PRODUCTS'
  );
  REPEAT i := LOINDEX(category_assignments) TO HIINDEX(category_assignments);
    categories := categories + category_assignments[i].category.name;
  END_REPEAT;
  RETURN (categories);

CASE rep.name OF 
     'document content' : 
      BEGIN
        RETURN (SIZEOF(QUERY(items <* rep\representation.items | NOT (items.
        name IN ['detail level', 'geometry type', 'real world scale']))) = 0);
      END;
     'document creation' : 
      BEGIN
        IF NOT (SIZEOF(QUERY(items <* rep\representation.items | NOT (items.
        name IN ['creating interface', 'creating system', 'operating system']))
        ) = 0) THEN
          RETURN (FALSE);
        END_IF;
        IF NOT (SIZEOF(QUERY(items <* rep\representation.items | NOT (items.
        name IN ['creating system']))) = 1) THEN
          RETURN (FALSE);
        ELSE
          RETURN (TRUE);
        END_IF;
      END;
     'document format' : 
      BEGIN
        RETURN (SIZEOF(QUERY(items <* rep\representation.items | NOT (items.
        name IN ['character code', 'data format', 'size format', 
        'size format standard']))) = 0);
      END;
     'document size' : 
      BEGIN
        RETURN (SIZEOF(QUERY(items <* rep\representation.items | NOT (items.
        name IN ['file size', 'page count']))) = 0);
      END;
    OTHERWISE  : RETURN (UNKNOWN);
  END_CASE;

REPEAT i := 1 TO HIINDEX(input2);
    IF NOT (input1 IN TYPEOF(input2)) THEN
      RETURN (FALSE);
    END_IF;
  END_REPEAT;
  RETURN (TRUE);

LOCAL
  vdr : SET OF view_definition_relationship := [];
  valid : BOOLEAN := TRUE;
  pvd : SET OF product_view_definition := [];
END_LOCAL;
  REPEAT i := 1 TO HIINDEX(input1);
    IF 
    'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.LAMINATE_COMPONENT'
     IN TYPEOF(input1[i]) THEN
      vdr := input1[i]\assembly_component.occurrence_contexts;
      pvd := [];
      REPEAT j := 1 TO HIINDEX(vdr);
        pvd := pvd + vdr[j]\view_definition_relationship.relating_view;
      END_REPEAT;
      IF NOT (input2 IN pvd) THEN
        valid := FALSE;
      END_IF;
    END_IF;
  END_REPEAT;
  RETURN (valid);

LOCAL
  imsa : SET OF interconnect_module_stratum_assembly_relationship := input.
  elements;
  s1 : SET OF stratum := [];
  ss : SET OF stratum_surface := [];
  ssp : SET OF stratum := [];
  sss : SET OF stratum := [];
  assd : SET OF adjacent_stratum_surface_definition := [];
  i : INTEGER := 0;
END_LOCAL;
  IF SIZEOF(imsa) > 0 THEN
    REPEAT i := 1 TO HIINDEX(imsa);
      s1 := s1 + imsa[i].component;
    END_REPEAT;
    REPEAT i := 1 TO HIINDEX(s1);
      ss := ss + USEDIN(s1[i], 
      'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.STRATUM_SURFACE.OF_STRATUM'
      );
    END_REPEAT;
    REPEAT i := 1 TO HIINDEX(ss);
      IF 
      'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.STRATUM_AVERAGE_SURFACE'
       IN TYPEOF(ss[i]) THEN
        ss := ss - ss[i];
      END_IF;
    END_REPEAT;
    REPEAT i := 1 TO HIINDEX(ss);
      assd := assd + USEDIN(ss[i], 
      'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.ADJACENT_STRATUM_SURFACE_DEFINITION.PRECEDENT_SURFACE'
      );
      assd := assd + USEDIN(ss[i], 
      'AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_ARM_LF.ADJACENT_STRATUM_SURFACE_DEFINITION.SUBSEQUENT_SURFACE'
      );
    END_REPEAT;
    REPEAT i := 1 TO HIINDEX(assd);
      ssp := ssp + assd[i].precedent_surface.of_stratum;
      sss := sss + assd[i].subsequent_surface.of_stratum;
    END_REPEAT;
    IF SIZEOF(assd) + 1 = SIZEOF(ssp) + SIZEOF(sss) THEN
      RETURN (TRUE);
    ELSE
      RETURN (FALSE);
    END_IF;
  END_IF;
